  "description": {
    "nb": "Datasett til bruk i ruteberegninger for syklende og gående. Statens vegvesen har brukt store ressurser på etablering av gang- og sykkelvegdata i Nasjonal vegdatabank . Formålet med dataetableringen har primært vært bedre drift og vedlikehold av gang- og sykkelvegnettet, og gjennom dette prosjektet ønsker vi å synliggjøre at sykkelvegdataene i NVDB har stor verdi også innen andre bruksområder. Det finnes ikke noe offisielt nasjonalt datasett som enkelt gir mulighet for digital sykkelruteplanlegging, men NVDB-data i kombinasjon med andre datakilder vil kunne danne grunnlaget for et slikt datasett. Her er data fra NVDB supplert med blant annet stier, traktorveger og småstubber fra Open Street Map . For nyheter, driftsmeldinger og tips om data fra Statens vegvesen, følg oss på twitter.com/VegvesenData ."
  },
