  "title": {
    "nb": "Utlysningstekster ledige stillinger - historikk"
  },
  "description": {
    "nb": "Stillingsutlysningstekster for ledige stilinger : registrert av arbeidsgiver på nav.no offentliggjort i media (stillingsportaler, websider, aviser, tidsskrifter, o.l.) og registrert av NAV meldt til NAV fra Eures nettverk for ledige stillinger i Europa NAV publiserer to årlige datasett om ledige stillinger. Et med stillingsutlysningstekster og et ledige stillinger meldt til NAV med strukturerte kjennetegn ved stilling. Disse kan kobles sammen ved felles stillingsnummer. Stillingsdata meldes og registreres i NAV basert på https://lovdata.no/lov/2004-12-10-76/§7 . Stillingsutlysninger som er meldt til NAV-kontorene som oppdrag er utelatt. Stillingstekstene inneholder i hovedsak den formattering som de har vært publisert i. Mange tekster inneholder derfor HTML-markører og redigeringstegn. Data er vasket slik at mesteparten av telefonnummer, epostadresser, navn, store tall (over 6 siffer), anførselstegn og kontrolltegn er fjernet og erstattet med symbolet #. Strukturerte kjennetegen for stillinger som er vasket bort kan hentes fra datasettet ledige stillinger meldt til NAV. Den tekniske løsningen som henter ut stillingstekster henter kun ut de 4000 første tegn av stillingstekstene. NAV har i 2017 i samarbeid med andre aktører i stillingsmarkedet fått økt antall stillinger i NAVs stilingsdatabase. Økningen har også ført til en større andel stillinger med over 4000 tegn, og som dessverre blir avkortet i dette datasettet. Mer informasjon: * Om statistikken ledige stillinger på nav.no * RSS og annen online tilgang til ledige stillinger på nav.no"
  },
