  "title": {
    "nb": "Kriterieveiviseren for bærekraftige anskaffelser",
    "en": "Kriterieveiviseren for bærekraftige anskaffelser"
  },
  "description": {
    "nb": "Direktoratet for forvaltning og IKTs (Difi) verktøy for bærekraftige anskaffelser gir formuleringer til krav og kriterier for miljø og sosialt ansvar, og dokumentasjon av kravene, som kan stilles i en anskaffelsesprosess. Kriterieveiviseren tilbyr en tjeneste for programmatisk oppslag på kriterier og grupperinger i Kriterieveiviseren. Dataene leveres i sanntid fra Kriterieveiviseren, og tjenesten kan f.eks. brukes av en backendløsning for å vaske eller oppdatere egne data. Datasettene er tilgjengelige i XML og JSON.",
    "en": "The Criteria Wizard for Sustainable Public Procurement (Kriterieveiviseren) is a tool by Agency for Public Management and eGovernment (Difi). The tool for sustainable procurement provides formulations for requirements and criteria for environment and social responsibility, and documentation on the requirements, that can be stipulated in a procurement process. The data sets provide free access to programmatic inquiries on criteria and groupings in the Criteria Wizard. The data is delivered in real time from the Criteria Wizard, and the service can e.g. be used by a backend solution to clean or update own data. The data sets are available in XML and JSON."
  },
  "descriptionFormatted": {
    "nb": "Direktoratet for forvaltning og IKTs (Difi) verktøy for bærekraftige anskaffelser gir formuleringer til krav og kriterier for miljø og sosialt ansvar, og dokumentasjon av kravene, som kan stilles i en anskaffelsesprosess. Kriterieveiviseren tilbyr en tjeneste for programmatisk oppslag på kriterier og grupperinger i Kriterieveiviseren. Dataene leveres i sanntid fra Kriterieveiviseren, og tjenesten kan f.eks. brukes av en backendløsning for å vaske eller oppdatere egne data. Datasettene er tilgjengelige i XML og JSON.",
    "en": "The Criteria Wizard for Sustainable Public Procurement (Kriterieveiviseren) is a tool by Agency for Public Management and eGovernment (Difi). The tool for sustainable procurement provides formulations for requirements and criteria for environment and social responsibility, and documentation on the requirements, that can be stipulated in a procurement process. The data sets provide free access to programmatic inquiries on criteria and groupings in the Criteria Wizard. The data is delivered in real time from the Criteria Wizard, and the service can e.g. be used by a backend solution to clean or update own data. The data sets are available in XML and JSON."
  },
