  "description": {
    "nb": "Disse datasettene har ikke blitt oppdatert siden 17. mars 2020. Nytt datasett med nytt format er under arbeid. Teknisk kjøretøyinformasjon består av følgende hoveddatasett: Enkeltgodkjente kjøretøy (tekn) : Alle enkeltgodkjente kjøretøy med teknisk informasjon og informasjon om registrering. Kjøretøyregistrering for typegodkjente kjøretøy (utek) : Kjøretøy med informasjon om registrering (første og siste registrering), siste og neste EU-kontroll (periodisk kjøretøykontroll, PKK), og dato for utbetalt vrakpant. Typegodkjenninger (typg) : Alle typegodkjenninger, med godkjenningsnummer og teknisk informasjon. For å finne teknisk informasjon for et typegodkjent kjøretøy må du: Bruke understellsnummer til å slå opp i «Kjøretøyregistrering for typegodkjente kjøretøy» (utek) og finne typegodkjenningsnummer Bruke typegodkjenningsnummer til å slå opp i «Typegodkjenninger» (typg) for å finne teknisk informasjon for denne typen NB! Se utfyllende informasjon om kilometerstand . I tillegg er det flere hjelpedatasett som hoveddatasettene peker til. Du kan søke på understellsnummer i API-ene. Etter en personvernvurdering er det i første omgang besluttet at kjennemerker på kjøretøy ikke vil bli lagt ut. Trenger du data med kjennemerker kan du søke om innsyn i det sentrale motorvognregisteret ."
