  "description": {
    "nb": "De aller fleste vil umiddelbart kunne identifisere noen av de mest kjente artene vi finner i Norge, og mange naturinteresserte kan artsbestemme en god del mer innen bestemte artsgrupper. Med over 45 000 arter i Norge, som ofte kun skilles på basis av små detaljer, er det imidlertid umulig å skille mellom alle arter uten hjelpemidler. Artsdatabanken publiserer digitale, ekspertskrevne bestemmelsesnøkler, som gjør det lettere å identifisere og lære mer om arter i Norge."
