  "title": {
    "nb": "Forslag budsjett og økonomiplan 2013-2016 for Bergen kommune"
  },
  "description": {
    "nb": "Bergen kommune gir ut byrådets forslag til budsjett og økonomiplan som åpne data, der du kan gjøre dine egne sammenstillinger av innholdet i drifts- og investeringsbudsjettet. Datafiler for nedlasting inkluderer byrådets forslag til budsjett 2013 og økonomiplan 2013-2016. Tjenesteområde 23 - Under streken - sentrale budsjettposter, genererer netto det totalbeløp som kan fordeles til bykassens tjenesteproduksjon, definert ved de øvrige tjenesteområdene 01-21. For få å sammenlignbare tall med enkelte av tabellene i budsjettdokumentet, må tjenesteområde 23 derfor holdes utenfor de tilfellene hvor en viser bykassens tjenesteproduksjon. Kostrafunksjoner kan utledes av de 3 første sifrene i våre 5-sifrede tjenestenumre. Mer om Kostra-funksjoner finner du hos www.ssb.no/kostra I enkelte av tabellene i budsjettdokumentet, har vi holdt Bergen kommunale bygg (BKB) og noen sentrale budsjettposter utenfor når vi har sett på endringene pr. tjenesteområde. I datagrunnlaget er alt samlet. Det er gjort for å vise tjenesteområdene slik bystyret skal vedta dem. Dataene som ligger i filene er ikke mer detaljerte enn dem du finner i budsjettdokumentene som er trykket eller lagt ut på kommunens nettsider. Endringer underveis Budsjettet er et levende dokument. Det vil si at det fra byrådet legger frem sin første innstilling til budsjettet endelig vedtas blir gjort endringer. Detaljeringen og den konkrete fordelingen av budsjettet på tjenestesteder, som sykehjem og skoler, blir først klart i februar 2013. Bergen kommune ønsker at informasjon om kommunens budsjett skal være lettest mulig tilgjengelig og så åpen som mulig for innbyggere og andre interesserte. Dette er viktig av hensyn til demokratiet og at kommunen forvalter store ressurser på vegne av fellesskapet."
  },
