  "description": {
    "nb": "IMDi gjennomfører rundt årsskiftet hvert år en undersøkelse om kommunenes arbeid med bosetting og integrering av flyktninger og innvandrere, og om kommunenes erfaringer med og oppfatninger av IMDi som samarbeidspartner. Undersøkelsen går til alle landets kommuner ved rådmannen, samt bydelsdirektør i Oslo. Undersøkelsen har blitt gjennomført siden 2014, og ble sist gjennomført ved årsskiftet 2017/2018. Dette datasettet inneholder svarene fra kommuner og bydeler i 2017/2018."
