  "title": {
    "nb": "Nasjonale rutedata for Norge",
    "en": "National time table data for Norway"
  },
  "description": {
    "nb": "Entur skal på oppdrag fra Samferdselsdepartementet samle inn, integrere og eksponere all kollektivtrafikkdata og gjøre de tilgjengelig både som rådatafiler og gjennom åpne APIer. Målsetningen er at dette skal senke terskelen for at tredjeparter kan bruke data for å lage nye, innovative løsninger for kollektivreisende. ?Om våre data Entur drifter nasjonalt stoppestedsregister, rutedatabase og sanntidshub. Det er utviklet et webgrensesnitt der alle kan se utforming, navngivning og attributter for stoppestedene i kart. Rutedatabasen inneholder data om alle transportformer i Norge. Det samles også inn sanntid fra alle parter i en sanntidshub. Det er etablert nasjonale standarder for utveksling av all relevant data. Nasjonalt reiseplanlegger API gir reiseforslag med samspill mellom rutedata, sanntidsdata, innfartsparkering, by-sykkel med mer. Om datasett Nasjonale rutedata har vært åpent tilgjengelig siden 2013 via API og rådata. Sommeren 2017 ble det innført nye åpne formater. Rådata er nå tilgjengelig i NeTEx norsk profil og GTFS (General Transit Feed Specification). Stoppesteder og reisesøk – inkludert sanntidsdata og avviksmeldinger – eksponeres gjennom åpne API’er. Rene sanntidsstrømmer er tilgjengelig via SIRI-formatet. Disse datasettene erstatter data delt gjennom Norsk Reiseinformasjon AS.",
    "en": "Entur has a mandate from the Norwegian Ministry of Transport and Communications collect, integrate and exposing all transit data and make them available both as raw data files and through open API’s. The goal is that this will lower the threshold for third parties and that they will make new, innovative solutions for public transport users. Our data Entur operates national stop place register, public transport route database and real time data hub. There is a web interface available where the user can see stop place design, name and attributes for each stop place in a map. The database contains data from all types of transportation in Norway. Entur also collects all available real time data sources into a hub. Entur has established national standards for exchanging all relevant data. The National travel planner API gives travel suggestion based on planned travel data, real time data, commuter parking, city bike and more. Datasets National travel planner has been available since 2013 via open API and raw data. During the summer 2017 it was introduced new open formats. Raw data is now available in NeTEx format, Norwegian profile and GTFS (General Transit Feed Specification). Stop places and travel search – real time and deviation messages included, is exposed through open API’s. Refined real time data streams are available via SIRI format. These sets replace data sets delivered by Norsk reiseinformasjon AS"
  },
  "descriptionFormatted": {
    "nb": "Entur skal på oppdrag fra Samferdselsdepartementet samle inn, integrere og eksponere all kollektivtrafikkdata og gjøre de tilgjengelig både som rådatafiler og gjennom åpne APIer. Målsetningen er at dette skal senke terskelen for at tredjeparter kan bruke data for å lage nye, innovative løsninger for kollektivreisende. ?Om våre data Entur drifter nasjonalt stoppestedsregister, rutedatabase og sanntidshub. Det er utviklet et webgrensesnitt der alle kan se utforming, navngivning og attributter for stoppestedene i kart. Rutedatabasen inneholder data om alle transportformer i Norge. Det samles også inn sanntid fra alle parter i en sanntidshub. Det er etablert nasjonale standarder for utveksling av all relevant data. Nasjonalt reiseplanlegger API gir reiseforslag med samspill mellom rutedata, sanntidsdata, innfartsparkering, by-sykkel med mer. Om datasett Nasjonale rutedata har vært åpent tilgjengelig siden 2013 via API og rådata. Sommeren 2017 ble det innført nye åpne formater. Rådata er nå tilgjengelig i NeTEx norsk profil og GTFS (General Transit Feed Specification). Stoppesteder og reisesøk – inkludert sanntidsdata og avviksmeldinger – eksponeres gjennom åpne API’er. Rene sanntidsstrømmer er tilgjengelig via SIRI-formatet. Disse datasettene erstatter data delt gjennom Norsk Reiseinformasjon AS.",
    "en": "Entur has a mandate from the Norwegian Ministry of Transport and Communications collect, integrate and exposing all transit data and make them available both as raw data files and through open API’s. The goal is that this will lower the threshold for third parties and that they will make new, innovative solutions for public transport users. Our data Entur operates national stop place register, public transport route database and real time data hub. There is a web interface available where the user can see stop place design, name and attributes for each stop place in a map. The database contains data from all types of transportation in Norway. Entur also collects all available real time data sources into a hub. Entur has established national standards for exchanging all relevant data. The National travel planner API gives travel suggestion based on planned travel data, real time data, commuter parking, city bike and more. Datasets National travel planner has been available since 2013 via open API and raw data. During the summer 2017 it was introduced new open formats. Raw data is now available in NeTEx format, Norwegian profile and GTFS (General Transit Feed Specification). Stop places and travel search – real time and deviation messages included, is exposed through open API’s. Refined real time data streams are available via SIRI format. These sets replace data sets delivered by Norsk reiseinformasjon AS"
  },
